DROP DATABASE IF EXISTS tcga;

CREATE DATABASE tcga;

CREATE TABLE `tcga`.`regulome_explorer_dataset`
(
 `label` varchar(40) NOT NULL,
  `method` varchar(100) default NULL,
  `source` varchar(100) default 'TCGA',
  `contact` varchar(50) default NULL,
  `comments` longtext,
  `pvalue_cutoff` double default NULL,
  `timestamp` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `default_display` bit(1) NOT NULL default b'0',
  `description` varchar(255) default NULL,
  `dataset_date` varchar(30) default NULL,
  `max_logged_pvalue` float default NULL,
  `input_files` varchar(255) default NULL,
  PRIMARY KEY  (`label`)
);

CREATE TABLE `tcga`.`sample_meta` (
  `sample_key` varchar(20) NOT NULL default '',
  `cancer_type` varchar(20) NOT NULL default '',
  `dataset_label` varchar(50) NOT NULL default '',
  `matrix_col_offset` int(11) default NULL,
  `meta_json` text,
  PRIMARY KEY  (`sample_key`,`cancer_type`,`dataset_label`));

DROP DATABASE IF EXISTS random_forest;

CREATE DATABASE random_forest;

CREATE TABLE `random_forest`.`chrom_info`
(
   chr_name varchar(20) PRIMARY KEY NOT NULL,
   chr_length int NOT NULL,
   organism varchar(50) default 'human',
   build varchar(20) default 'hg18'
);

CREATE TABLE `random_forest`.`refgene`
(
   chr varchar(5) NOT NULL,
   start int NOT NULL,
   end int NOT NULL,
   name varchar(30) DEFAULT 'NA' NOT NULL PRIMARY KEY,
   alias varchar(30) DEFAULT 'NA' NOT NULL,
   organism varchar(50) default 'human',
   build varchar(20) default 'hg18'
);

